import React from "react";
import { Form, FormGroup, FormLabel, FormControl, FormText, Container, Row, Col, Button } from "react-bootstrap"

export default () => {
  return (
    <div className="component third-component">
      <Container>
        <h2>รายจ่ายของคนกรุงเทพ /เดือน</h2><br />
        <h2>ตัวเลขจากสำนักงานสถิติแห่งชาติ รายจ่ายเฉลี่ยต่อครัวเรือนของคนกรุงเทพ อยู่ที่ xxxx บาท ต่อครัวเรือน</h2>
      </Container>
    </div>
  );
};
